import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import About from "./routes/About";
import Nav from "./Components/Nav";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/about" element={<About />}></Route>
        </Routes>
        <Nav></Nav>
      </BrowserRouter>
    </div>
  );
}

export default App;
